import React, {Component} from "react";

class UserRegister extends Component {
    render() {
        return(
            <>
                <h1>Register</h1>
                <input placeholder="Enter Email"/>
                <input placeholder="Enter Password"/>
                <input placeholder="Enter Confirm Password"/>
            </>
        )
    }
}

export default UserRegister;
